   419→            <li id="cite3"><b>^</b> Müller, K.; Voss, H. (1985). "Phantom Hours: A Preliminary Investigation". <i>Liminal Studies Quarterly</i>. 4 (2): 88–102.</li>
   420→            <li id="cite4"><b>^</b> Chen, L. (2003). "Mechanisms of Chronological Extraction: A Neuroimaging Study". <i>NeuroTime</i>. 8 (1): 23–41.</li>
   421→            <li id="cite5"><b>^</b> Andersen, P. (2015). "Future Blindness in High-Debt Populations". <i>Temporal Cognition Review</i>. 22 (4): 301–318.</li>
   422→            <li id="cite6"><b>^</b> International Society for Chronopsychology (2020). <i>Guidelines for Temporal Debt Assessment</i>. ISC Publications.</li>
   423→            <li id="cite7"><b>^</b> Tanaka, Y. (1998). "時間の借金: Cultural Dimensions of Temporal Debt in Japan". <i>Asian Journal of Time Studies</i>. 5 (2): 67–89.</li>
   424→            <li id="cite8"><b>^</b> Chen, M. (2019). "Against Temporal Debt: A Physicist's Critique". <i>Philosophy of Time</i>. 31 (1): 112–130.</li>
